import React,{useState} from 'react'
import axios from 'axios'

export function AddEntryPage(){
    const [values,setState] = useState({
    name:"",
    itemName:"",
    itemPrice:0.0,
    itemLink:""
    });

  const handleChange = event => {
    setState({...values,[event.target.name]:event.target.value})
  }
  const handleSubmit = event =>{
    event.preventDefault();
    
    axios.post('http://localhost:8000/list/addEntry',values).then(res=>{
      console.log(res);
      console.log(res.data);
    })
  }
    return (
    <div class="vh-100 bg-secondary text-center">
      <form onSubmit={handleSubmit}>
        <label for="NameInput" class="form-label fw-bold text-capitalize fs-4">Name</label>
        <div class="d-flex justify-content-center">
          <input name='name' type="name" class="form-control w-25" id="name" placeholder="Name" onChange={handleChange}></input>
        </div>

        <label for="ItemNameInput" class="form-label fw-bold text-capitalize fs-4">Item Name</label>
        <div class="d-flex justify-content-center">
          <input name='itemName' type="name" class="form-control w-25" id="itemName" placeholder="Item Name" onChange={handleChange}></input>
        </div>

        <label for="ItemPriceInput" class="form-label fw-bold text-capitalize fs-4">Item Price</label>
        <div class="d-flex justify-content-center">
          <input name='itemPrice' type="name" class="form-control w-25" id="itemPrice" placeholder="Item Price" onChange={handleChange}></input>
        </div>

        <label for="ItemLinkInput" class="form-label fw-bold text-capitalize fs-4">Item Link</label>
        <div class="d-flex justify-content-center">
          <input name='itemLink' type="name" class="form-control w-25" id="itemLink" placeholder="Item Link" onChange={handleChange}></input>
        </div>
        <div class="d-flex justify-content-center">
        <button type="submit" class="btn btn-primary mt-2">Add Item</button>
        </div>
      </form>  
    </div>
  )
  
}
export default AddEntryPage
